--Create the ETL Metadata table using the MS work

--------------------------------------------------------------------------------------------------------------------------------------------------------------
----This script creates and populates the App.EtlMetadata table which is the "right" side of the
----ETL Checklist. There are two new columns:
----1. PresentationSortOrder - If you want to display the information, it should be sorted using the PresentationSortOrder column
----2. CrossFileCombinationId - This ID looks across similar EDFacts file specs and creates an ID where a state may use similar data sources for that same
----                            row of information.
---------------------------------------------------------------------------------------------------------------------------------------------------------------

DROP TABLE IF EXISTS [App].[EtlMetadata]

CREATE TABLE [App].[EtlMetadata] (
	[EtlMetadataId] [int] IDENTITY(1,1) NOT NULL,
	[PresentationSortOrder] [int] NULL,
	[CrossFileCombinationId] [int] NULL,
	[EDFacts_File_Spec_Number] [varchar](max) NULL,
	[CEDS_Path] [varchar](max) NULL,
	[CEDS_Element_Name] [varchar](max) NULL,
	[CEDS_Element_Definition] [varchar](max) NULL,
	[CEDS_Data_Type] [varchar](max) NULL,
	[CEDS_Data_Length] [varchar](max) NULL,
	[CEDS_Option_Set_Code] [varchar](max) NULL,
	[CEDS_Option_Set_Description] [varchar](max) NULL,
	[CEDS_Element_Global_ID] [varchar](max) NULL,
	[CEDS_Element_Data_Model_ID] [varchar](max) NULL,
	[Destination_Staging_Table_Name] [varchar](max) NULL,
	[Destination_Staging_Column_Name] [varchar](max) NULL,
	[Destination_Staging_Column_DataType] [varchar](max) NULL,
	[Destination_Staging_Column_DataLength] [varchar](max) NULL,
	[Destination_RDS_Dimension_Table_Name] [varchar](max) NULL,
	[Destination_RDS_Dimension_Column_Name] [varchar](max) NULL,
	[Destination_RDS_Fact_Table_Name] [varchar](max) NULL,
	[Destination_RDS_Fact_Column_Name] [varchar](max) NULL,
	[Destination_RDS_Report_Table_Name] [varchar](max) NULL,
	[Destination_RDS_Report_Column_Name] [varchar](max) NULL,
 CONSTRAINT [PK_EtlMetadata] PRIMARY KEY CLUSTERED 
(
	[EtlMetadataId] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON, FILLFACTOR = 80, OPTIMIZE_FOR_SEQUENTIAL_KEY = OFF) ON [PRIMARY]
) ON [PRIMARY] TEXTIMAGE_ON [PRIMARY]
GO
SET IDENTITY_INSERT [App].[EtlMetadata] ON 

INSERT [App].[EtlMetadata] (
	[EtlMetadataId]
	, [PresentationSortOrder]
	, [CrossFileCombinationId]
	, [EDFacts_File_Spec_Number]
	, [CEDS_Path], [CEDS_Element_Name]
