 (1065, 14, 335, N'FS137', N'K12 -> K12 Student -> English Learner', N'English Learner Status', N'In coordination with the state''s definition based on Section 8101(20) of the ESEA, as amended by the ESSA, the term ''English learner'', when used with respect to an individual, means an individual: (A) who is aged 3 through 21; (B) who is enrolled or preparing to enroll in an elementary school or a secondary school; (C)  (i) who was not born in the United States or whose native languages are languages other than English; (ii)  (I) who is a Native American or Alaska Native, or a native resident of the outlying areas; and (II) who comes from an environment where a language other than English has had a significant impact on the individual''s level of English language proficiency; or (iii) who is migratory, whose native language is a language other than English, and who come from an environment where a language other than English is dominant; and (D) whose difficulties in speaking, reading, writing, or understanding the English language may be sufficient to deny the individual  (i) the ability to meet the challenging State academic standards; (ii) the ability to successfully achieve in classrooms where the language of instruction is English; or (iii) the opportunity to participate fully in society.', N'Option Set', N'`', N'Yes', N'Yes', N'000180', N'65986', N'PersonStatus', N'EnglishLearnerStatus', N'bit', N'1', N'DimEnglishLearnerStatuses', N'EnglishLearnerStatusCode', N'FactK12StudentAssessments', N'EnglishLearnerStatusId', N'N/A - Not migrated to this data layer', N'N/A - Not migrated to this data layer'),
