 (1857, 30, 287, N'FS037', N'K12 -> K12 Student -> Disability', N'IDEA Indicator', N'A person having intellectual disability; hearing impairment, including deafness; speech or language impairment; visual impairment, including blindness; serious emotional disturbance (hereafter referred to as emotional disturbance); orthopedic impairment; autism; traumatic brain injury; developmental delay; other health impairment; specific learning disability; deaf-blindness; or multiple disabilities and who, by reason thereof, receive special education and related services under the Individuals with Disabilities Education Act (IDEA) according to an Individualized Education Program (IEP), Individual Family Service Plan (IFSP), or service plan.', N'Option Set', NULL, N'Yes', N'Yes', N'000151', N'59771', N'ProgramParticipationSpecialEducation', N'IDEAIndicator', N'bit', N'1', N'DimIdeaStatuses', N'IdeaIndicatorCode', N'FactK12StudentCounts', N'IdeaStatusId', N'ReportEDFactsK12StudentCounts', N'IDEAINDICATOR'),
 (1858, 30, 336, N'FS151', N'K12 -> K12 Student -> English Learner', N'English Learner Status', N'In coordination with the state''s definition based on Section 8101(20) of the ESEA, as amended by the ESSA, the term ''English learner'', when used with respect to an individual, means an individual: (A) who is aged 3 through 21; (B) who is enrolled or preparing to enroll in an elementary school or a secondary school; (C)  (i) who was not born in the United States or whose native languages are languages other than English; (ii)  (I) who is a Native American or Alaska Native, or a native resident of the outlying areas; and (II) who comes from an environment where a language other than English has had a significant impact on the individual''s level of English language proficiency; or (iii) who is migratory, whose native language is a language other than English, and who come from an environment where a language other than English is dominant; and (D) whose difficulties in speaking, reading, writing, or understanding the English language may be sufficient to deny the individual  (i) the ability to meet the challenging State academic standards; (ii) the ability to successfully achieve in classrooms where the language of instruction is English; or (iii) the opportunity to participate fully in society.', N'Option Set', NULL, N'No', N'No', N'000180', N'65783', N'PersonStatus', N'EnglishLearnerStatus', N'bit', N'1', N'DimEnglishLearnerStatuses', N'EnglishLearnerStatusCode', N'FactK12StudentCounts', N'EnglishLearnerStatusId', N'ReportEDFactsK12StudentCounts', N'ENGLISHLEARNERSTATUS'),
