 (2083, 35, 282, N'FS151', N'K12 -> K12 Student -> Homeless -> Homelessness Status', N'Homelessness Status', N'Children and youth who lack a fixed, regular, and adequate nighttime residence. Homeless children and youth include: 1) children and youth who are sharing the housing of other persons due to loss of housing, economic hardship, or a similar reason; are living in motels, hotels, trailer parks, or camping grounds due to the lack of alternative adequate accommodations; are living in emergency or transitional shelters; are abandoned in hospitals; or are awaiting foster care placement; 2) children and youth who have a primary nighttime residence that is a public or private place not designed for or originally used as a regular sleeping accommodation for human beings; or 3) children and youths who are living in cars, parks, public spaces, abandoned buildings, substandard housing, bus or train stations, or similar settings. 4) migratory children who qualify as homeless because the children are living in circumstances described in the above. (See Section 103 of the McKinney Act for a more detailed description of this data element).', N'Option Set', NULL, N'No', N'No', N'000149', N'65769', N'PersonStatus', N'HomelessnessStatus', N'bit', N'1', N'DimHomelessnessStatuses', N'HomelessStatusCode', N'FactK12StudentCounts', N'HomelessnessStatusId', N'ReportEDFactsK12StudentCounts', N'HOMELESSNESSSTATUS'),
