 (2249, 41, 282, N'FS040', N'K12 -> K12 Student -> Homeless', N'Homelessness Status', N'Children and youth who lack a fixed, regular, and adequate nighttime residence. Homeless children and youth include: 1) children and youth who are sharing the housing of other persons due to loss of housing, economic hardship, or a similar reason; are living in motels, hotels, trailer parks, or camping grounds due to the lack of alternative adequate accommodations; are living in emergency or transitional shelters; are abandoned in hospitals; or are awaiting foster care placement; 2) children and youth who have a primary nighttime residence that is a public or private place not designed for or originally used as a regular sleeping accommodation for human beings; or 3) children and youths who are living in cars, parks, public spaces, abandoned buildings, substandard housing, bus or train stations, or similar settings. 4) migratory children who qualify as homeless because the children are living in circumstances described in the above. (See Section 103 of the McKinney Act for a more detailed description of this data element).', N'Option Set', NULL, N'No', N'No', N'000149', N'59769', N'PersonStatus', N'HomelessnessStatus', N'bit', N'1', N'DimHomelessnessStatuses', N'HomelessnessStatusCode', N'FactK12StudentCounts', N'HomelessnessStatusId', N'ReportEDFactsK12StudentCounts', N'HOMELESSNESSSTATUS'),
 (2250, 41, 336, N'FS002', N'K12 -> K12 Student -> English Learner', N'English Learner Status', N'In coordination with the state''s definition based on Section 8101(20) of the ESEA, as amended by the ESSA, the term ''English learner'', when used with respect to an individual, means an individual: (A) who is aged 3 through 21; (B) who is enrolled or preparing to enroll in an elementary school or a secondary school; (C)  (i) who was not born in the United States or whose native languages are languages other than English; (ii)  (I) who is a Native American or Alaska Native, or a native resident of the outlying areas; and (II) who comes from an environment where a language other than English has had a significant impact on the individual''s level of English language proficiency; or (iii) who is migratory, whose native language is a language other than English, and who come from an environment where a language other than English is dominant; and (D) whose difficulties in speaking, reading, writing, or understanding the English language may be sufficient to deny the individual  (i) the ability to meet the challenging State academic standards; (ii) the ability to successfully achieve in classrooms where the language of instruction is English; or (iii) the opportunity to participate fully in society.', N'Option Set', N'1000', N'No', N'No', N'000180', N'65783', N'PersonStatus', N'EnglishLearnerStatus', N'bit', N'1', N'DimEnglishLearnerStatuses', N'EnglishLearnerStatusCode', N'FactK12StudentCounts', N'EnglishLearnerStatusId', N'ReportEDFactsK12StudentCounts', N'ENGLISHLEARNERSTATUS'),
