 (2810, 77, 281, N'FS188', N'K12 -> K12 Student -> Homeless', N'Homelessness Status', N'Children and youth who lack a fixed, regular, and adequate nighttime residence. Homeless children and youth include: 1) children and youth who are sharing the housing of other persons due to loss of housing, economic hardship, or a similar reason; are living in motels, hotels, trailer parks, or camping grounds due to the lack of alternative adequate accommodations; are living in emergency or transitional shelters; are abandoned in hospitals; or are awaiting foster care placement; 2) children and youth who have a primary nighttime residence that is a public or private place not designed for or originally used as a regular sleeping accommodation for human beings; or 3) children and youths who are living in cars, parks, public spaces, abandoned buildings, substandard housing, bus or train stations, or similar settings. 4) migratory children who qualify as homeless because the children are living in circumstances described in the above. (See Section 103 of the McKinney Act for a more detailed description of this data element).', N'Option Set', NULL, N'Yes', N'Yes', N'000149', N'59769', N'PersonStatus', N'HomelessnessStatus', N'bit', N'1', N'DimHomelessnessStatuses', N'HomelessnessStatusCode', N'FactK12StudentAssessments', N'HomelessnessStatusId', N'ReportEDFactsK12StudentAssessments', N'HOMELESSNESSSTATUS'),
 (2811, 77, 350, N'FS179', N'K12 -> K12 Student -> Migrant', N'Migrant Status', N'Persons who are, or whose parents or spouses are, migratory agricultural workers, including migratory dairy workers, or migratory fishers, and who, in the preceding 36 months, in order to obtain, or accompany such parents or spouses, in order to obtain, temporary or seasonal employment in agricultural or fishing work (A) have moved from one LEA to another; (B) in a state that comprises a single LEA, have moved from one administrative area to another within such LEA; or (C) reside in an LEA of more than 15,000 square miles, and migrate a distance of 20 miles or more to a temporary residence to engage in a fishing activity.', N'Option Set', NULL, N'No', N'No', N'000189', N'59789', N'PersonStatus', N'MigrantStatus', N'bit', N'1', N'DimMigrantStatuses', N'MigrantStatusCode', N'FactK12StudentAssessments', N'MigrantStatusId', N'ReportEDFactsK12StudentAssessments', N'MIGRANTSTATUS'),
